import React from 'react';
import Navbar from '../Navbar/Navbar';
import './Style.css'

function Home(props) {
    const card = [
        { Name: " Queues", extra: "Avoid queue in the cafeteria", img: "../images/download (1).jpeg" },
        { Name: "Save you money ", extra: ", ", img: "../images/download (1).png" },
        { Name: " ", extra: "", img: "../images/download.jpeg" },
        { Name: " ", extra: "", img: "../images/download (2).jpeg" },
    ]
    return (
        <React.Fragment>
            <header>
                <Navbar />
            </header>
            <div className="body container border-left border-right">
                <div className="p-3 h2 ">Welcome to Caleb Mobile Waiter CWM</div>
                <div className="txt2">
                    Make orders with us and get your order under 1 hour <br />
                   Note : No refunds
               </div>
                <button className=" btn border-info text-info w-25 mx-auto btn-outline  btn-info-outline" onClick={() => {
                    window.location.assign('/order')
                }}>
                    Order
               </button>
                {card.map(({ Name, extra, img }) => {
                    return (
                        <div className="card col-lg-6 col-sm-9 mx-auto shadow rounded my-5" style={{ backgroundColor: "url('../images/download (1).jpeg')" }}>
                            <img src={img} width="100%" alt="" className="border-bottom" height="200px" />
                            <div className="p-3">
                                    <span className="h4">{Name}</span>  <br/> 
                                    <span className="h5">{extra}</span>
                            </div>
                        </div>
                    )
                })}
            </div>
        </React.Fragment>
    );
}
export default Home;
